def isValid(s):
    dictionary = {}
    for x in s:
        if x in dictionary:
            dictionary[x] +=1
        else:
            dictionary[x] =1
    arr = [dictionary[x] for x in dictionary]
    print(arr)
    maxVal = max(arr)
    minVal = min(arr)
    if arr.count(maxVal) == len(arr):
        return "YES"
    if arr.count(maxVal) == 1 and arr.count(maxVal-1) == len(arr)-1 and maxVal-1 == minVal:
        return "YES"
    elif arr.count(maxVal) == len(arr)-1 and minVal ==1:
        return "YES"
    else:
        return "NO"

print(isValid(""))